import {useEffect, useState} from 'react'
import './App.css';
import NavBar from './components/NavBar';

function App() {

  useEffect(() => {

    // Fetch the username from the cookie
    // async function fetch() {
    //   await getUser().then((response) => {
    //     if ("response is not null") {
    //       setUser("INSERT USERNAME HERE");
    //     }
    //   })
    // }
    // fetch();

  }, []);
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar />
          <Routes>
            <Route element={<UnauthenticatedRoute />}>
              <Route path="/login" element={<LoginPage />} />
              <Route path="/signup" element={<SignupPage />} />
            </Route>

            <Route element={<AuthenticatedRoute />}>
              <Route path="/home" element={<HomePage />} />
              <Route path="/news" element={<NewsFeedPage />} />
              <Route path="/visualizer" element={<VisualizerPage />} />
              <Route path="/chat" element={<ChatPage />} />
              <Route path="/wall" element={<WallPage />} />
              <Route path="/notifs" element={<NotifsPage />} />
              <Route path="/friends" element={<FriendsPage />} />
              <Route path="/edit" element={<EditProfilePage />} />
              <Route path="/wall/:id" element={<WallPage />} key={window.location.pathname}/>
            </Route>

            <Route path="/" element={<RedirectRoute auth="/home" notAuth="/login" />} />
            <Route path="/*" element={<NotFoundPage />} />
          </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
